import "./App.css";
import Navbar from "./components/Navbar";
import Home from "./components/Home";
import Product from "./components/Product";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Home />
      <Product />
    </div>
  );
}

export default App;
